from collections import defaultdict


class Solution(object):
    def takeCharacters(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: int
        """
        def isValid():
            for ch in dicts:
                if total[ch] - dicts[ch] < k:
                    return False
            return True

        # pre-process
        L = len(s)
        total = {"a": 0, "b": 0, "c": 0}
        for ch in s:
            total[ch] += 1

        # process
        # sliding window
        from collections import defaultdict
        dicts = {"a": 0, "b": 0, "c": 0}
        left, right = 0, 0
        ans = float("inf")
        while right < L:
            dicts[s[right]] += 1
            right += 1
            while left < right and not isValid():
                dicts[s[left]] -= 1
                left += 1
            if isValid():
                ans = min(ans, L - (right - left))
        return -1 if ans == float("inf") else ans


